                    <li className="text-white  small ml-0 mr-3 bolding list-unstyled">HOME</li>
                    <li className="text-white  small mx-3   bolding list-unstyled">ALL CATEGORIES</li>
                    <li className="text-white  small mx-3   bolding list-unstyled">NEW LAPTOPS</li>
                    <li className="text-white  small mx-3   bolding list-unstyled">LODON/UK USE</li>
                    <li className="text-white  small mx-3  bolding list-unstyled">ACCESORIES</li>
                </nav>

            </>
        )
    }
}
export default Nav3
